import styled from 'styled-components';

const PageWrapper = styled.input`
    width: 100%;
`;

export default function PhoneInput(props) {

    const {phone} = props;
    const {setPhone} = props;

    return (
       <PageWrapper
            type = 'text'
            value = {phone}
            onChange = {(e) => handleInput(e)}
        />
    )
}
